    {
      matchup[0] = <img className="logos" src={miaLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(nwe)))
    {
      matchup[1] = <img className="logos" src={nweLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(nwe)))
    {
      matchup[0] = <img className="logos" src={nweLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(nyj)))
    {
      matchup[1] = <img className="logos" src={nyjLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(nyj)))
    {
      matchup[0] = <img className="logos" src={nyjLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(cin)))
    {
      matchup[1] = <img className="logos" src={cinLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(cin)))
    {
      matchup[0] = <img className="logos" src={cinLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(cle)))
    {
      matchup[1] = <img className="logos" src={cleLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(cle)))
    {
      matchup[0] = <img className="logos" src={cleLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(pit)))
    {
      matchup[1] = <img className="logos" src={pitLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(pit)))
    {
      matchup[0] = <img className="logos" src={pitLogo} alt="logo" width="87" height="87"/>
    }
    if (homeTeam.find(a => a.includes(nyj)))
    {
      matchup[1] = <img className="logos" src={nyjLogo} alt="logo" width="87" height="87"/>
    }
    else if (awayTeam.find(b => b.includes(nyj)))
    {
      matchup[0] = <img className="logos" src={nyjLogo} alt="logo" width="87" height="87"/>
    }


    return (matchup)

  }

  function setWeeklyMatchups()
  {
    return(
            teams.map(team =>
              <tr key={team.toString()}>
                <td className='matchups'>
                  {setEachMatchup(team)}
                </td>
              </tr>
            )
          )
  }


  return (
    <>
    <table className="allTeams">
      <tbody>

        <tr>
          <th >Week 1 Match ups</th>
        </tr>

        {setWeeklyMatchups()}

      </tbody>
    </table>
    </>
  );
}

export default NewHome;
